import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import * as serviceWorker from './serviceWorker';

ReactDOM.render(<BrowserRouter>
    <AppRouter/>
</BrowserRouter>, document.getElementById('root'));
serviceWorker.unregister();
